import './App.css';
import Logo from './components/logo';
import OpcoesHeader from './components/opções-header';

const textoOpcoes = ['Projetos', 'Esqueci'];

function App() {
  return (
    <div className='App'>
      <header className='App-header'>
        <Logo/>
        <OpcoesHeader/>
      </header>
      <h2 className='texto_construcao'>Introdução a robotica com projetos simples</h2>
    </div>
  );
}

export default App;
